import React from "react";

const Contact = () => {
  return (
    <>
      <div className="contact_container">
        <img
          className="contact_image"
          src="./image6.jpg"
          alt="Contact_Hero_image"
        />
        <h1 className="contact_title">
          Dolor dolor enim eu id dolor exercitation pariatur incididunt nostrud
          excepteur consequat voluptate officia.
        </h1>
        <p className="contact_txt"></p>
      </div>
    </>
  );
};

export default Contact;
